import React from "react";


function Note(props) {
  return (
    <div className="note">
      <div className="cardHeading">
      <h1>{props.name}</h1>
      <p>{props.address}</p>
      </div>
    
      <img className="TimeSVG"nsrc="https://raw.githubusercontent.com/snehiljain34/images/9623f3fe030460c3047e760b86a5f917a6c7aeb9/time.svg"/><p>{props.from} to {props.to}</p>
      <p><span>Dose 1:</span> {props.available_capacity_dose1}</p>
      <p><span>Dose 2:</span> {props.available_capacity_dose2}</p>
      <p>{props.vaccine}</p>
    </div>
  );
}

export default Note;
